import styled from "@emotion/styled";

export const GridLayout = styled.div`
  display: grid;
  grid-template-columns: repeat(3, 1fr);
  gap: 1.5rem;
  > * {
    &:last-child {
      grid-column-start: 3;
      grid-row: 1 / span 2;
    }
  }
`;
